const SocialLink = ({ id, href, icon, linkClass }) => {
  return (
    <ul className='nav-icons'>
      {socialLinks.map(link => {
        const { id, href, icon } = link;
        return (
          <li key={id}>
            <a
              href={href}
              target='_blank'
              rel='noreferrer'
              className='nav-icon'
            >
              <i className={icon}></i>
            </a>
          </li>
        );
      })}
    </ul>
  );
};
export default SocialLink;
